WHENEVER SQLERROR CONTINUE;

--DROP TABLE GLM_TABLES CASCADE CONSTRAINTS;
CREATE TABLE GLM_TABLES  (
   TABLE_ID NUMBER(10) default 0 not null,
   TABLE_NAME VARCHAR2(32) not null,
   FEATURE_TYPE NUMBER(1) DEFAULT 0 NOT NULL,
   IS_MAIN NUMBER(1) DEFAULT 0 NOT NULL,
   OBJ_NAME VARCHAR2(32),
   OBJ_PID_COL VARCHAR2(512),
   EDITABLE NUMBER(1) default 0 not null,
   GDB_VERSION VARCHAR2(8) not null,
   constraint PK_GLM_TABLES primary key (TABLE_ID)
);

-- COMMENTS
comment on column GLM_TABLES.TABLE_ID is '主键';
comment on column GLM_TABLES.TABLE_NAME is '表名';
comment on column GLM_TABLES.FEATURE_TYPE is '所属要素类型，1-POI,2-ROAD';
comment on column GLM_TABLES.IS_MAIN is '是否为要素的主表，0否1是';
comment on column GLM_TABLES.OBJ_NAME is '所属对象名';
comment on column GLM_TABLES.OBJ_PID_COL is '所属对象pid的字段,三级子表为空';
comment on column GLM_TABLES.EDITABLE is '是否在平台上编辑，0否1是';
comment on column GLM_TABLES.GDB_VERSION is 'gdb模型版本，如240,270+,...';

-- Create sequence
-- DROP SEQUENCE GLM_TABLE_SEQ;
create sequence GLM_TABLE_SEQ
minvalue 1
maxvalue 9999999999999999999999999999
start with 1
increment by 1
cache 20;


COMMIT;
-- select count(1) from glm_table;

DROP TABLE GLM_GRID_MAP CASCADE CONSTRAINTS;
CREATE TABLE GLM_GRID_MAP (
   TABLE_NAME VARCHAR2(32),
   REF_COL_NAME VARCHAR2(32),
   REF_INFO VARCHAR2(512),
   SINGLE_MESH NUMBER(1), 
   GDB_VERSION VARCHAR2(16)
);
-- COMMENTS
COMMENT ON COLUMN GLM_GRID_MAP.TABLE_NAME IS '表名';
COMMENT ON COLUMN GLM_GRID_MAP.REF_COL_NAME IS '用来关联其他表的字段';
COMMENT ON COLUMN GLM_GRID_MAP.REF_INFO IS '关联信息';
COMMENT ON COLUMN GLM_GRID_MAP.SINGLE_MESH IS '是否有MESH_ID字段，0否1是';
COMMENT ON COLUMN GLM_GRID_MAP.GDB_VERSION IS 'gdb模型版本，如250,270+,...';

